import React, { Component } from 'react'

class Nav extends Component {
    render() {
        return (
            <ul>
                <li><a className="active" href="#home">Home</a></li>
                <li><a href="#browse">News</a></li>
                <li><a href="#contact">Contact</a></li>
                <li><a href="#about">About</a></li>
            </ul>
        )
    }
}

export default Nav
